defaultdict(<class 'dict'>, {'viewport': 'width=device-width, minimum-scale=1, initial-scale=1, maximum-scale=1, user-scalable=0', 'description': 'সিলেট স্টেশন থেকে কালনী এক্সপ্রেসের ঢাকার উদ্দেশে ছেড়ে যাওয়ার সময় সকাল ৬টা ৪০ মিনিট। ২ ঘণ্টা ৫ মিনিট বিলম্বের পর গতকাল রোববার এই ট্রেন ছেড়েছে সকাল ৮টা ৪৫ মিনিটে। সকাল ৮টা ৪০ মিনিটের জয়ন্তিকা এক্সপ্রেস ছেড়েছে বেলা পৌনে ১১টায়। আর পাহাড়িকা এক্সপ্রেস ছেড়েছে ১০ মিনিট বিলম্বে সকাল ১০টা ২৫ মিনিটে।&nbsp;
